pragma solidity ^0.8.0;

contract Faucet {
    address public owner;

    constructor() payable { 
        owner = msg.sender;
    }

    function withdraw (uint _amount) public {
        require(_amount <= 10000000000);
        payable(msg.sender).transfer(_amount);
    }
}

